import React from 'react';
import classes from './Header.module.css';

const Header = props => {
	return (
		<>
			<header className={classes.header}>
				<h1>Jeong Meals</h1>
				<button>Cart</button>
			</header>
			<img className={classes.mainImage} src="https://raw.githubusercontent.com/academind/react-complete-guide-code/11-practice-food-order-app/extra-files/meals.jpg" alt="ㅡㄷ미-image"/>
		</>
	);
}

export default Header;
